import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav
        className="navbar navbar-expand-sm"
        style={{ backgroundColor: "#e3f2fd" }}
      >
        <a class="navbar-brand">
          MERN LOGIN SYSTEM w/ text
        </a>
      </nav>
    );
  }
}

export default Navbar;
